import { Box, Button, TextField, Dialog, DialogActions, DialogContent, 
    DialogTitle} from '@material-ui/core';


import React from 'react';

type Props = {
    openCreateThread: boolean;
    handleCloseCreateThread: () => void;
}

const CreateThread: React.FC<Props> = ({openCreateThread, handleCloseCreateThread}: Props) => {
    return (
        <Box>
            <Dialog open={openCreateThread} onClose={handleCloseCreateThread}>
                <DialogTitle>What's on your mind?</DialogTitle>
                <DialogContent>
                    <TextField
                        autoFocus
                        margin="normal"
                        label="Title"
                        fullWidth
                        variant="standard"
                        multiline
                    />
                    <TextField
                        margin="normal"
                        label="Say something here.."
                        type="email"
                        fullWidth
                        variant="standard"
                        multiline
                    />
                </DialogContent>
                <DialogActions>
                <Button onClick={handleCloseCreateThread}>Cancel</Button>
                <Button onClick={handleCloseCreateThread}>Create Thread</Button>
                </DialogActions>
            </Dialog>
        </Box>
    );
};

export default CreateThread;
